import React, { useState,useEffect } from 'react';

import Card from '../../shared/components/UIElements/Card';
import './GetAllQuestions.css';
import Button from "../../shared/components/Button/Button";
import Modal from "../../Model/Model";
import { useForm } from '../../shared/Hooks/form-hook';
import ErrorModel from '../../Model/ErorrModel';

const GetAllQuestions = props => {
  // const [showConfirmModal, setShowConfirmModal] = useState(false);

  // const showDeleteWarningHandler = () => {
  //   setShowConfirmModal(true);
  // };

  // const cancelDeleteHandler = () => {
  //   setShowConfirmModal(false);
  // };

  // const confirmDeleteHandler = () => {
  //   setShowConfirmModal(false);
  //   console.log('DELETING...');
  // };
  // const history = useHistory();
  const [loadedQuestions, setLoadedQuestions] = useState();
  const [isLoading, setIsLoading] = useState(true);
  // const questionId = useParams().questionId;
  const [error, setError] = useState();
  // console.log(questionId);
  // const auth = useContext(AuthContext);


  const [formState, inputHandler, setFormData] = useForm(
    {
      name: {
        value: "",
        isValid: false
      },
      category: {
        value: "",
        isValid: false
      },
      subCategory: {
        value: "",
        isValid: false
      },
      mark: {
        value: "",
        isValid: false
      },
      expextedTime: {
        value: "",
        isValid: false
      }
      ,
      correctAnswers: {
        value: "",
        isValid: false
      }
      ,
      createdAt: {
        value: "",
        isValid: false
      },
      answers: {
        answer: {
          value: "",
          isValid: false
        },
        description: {
          value: "",
          isValid: false
        }
      }
    },
    false
  );


  useEffect(() => {
    console.log("test update");
    const fetchQuestion = async () => {
      setIsLoading(true);
      try {
        console.log("test try in update")
        const responseData = await axios.get(
          "http://localhost:5000/api/questions"
        );
        // const u=`http://localhost:5000/api/questions/user/${questionId}`;
        // console.log(u);
        // console.log(questionId);
        // console.log(responseData.data.question);
        setLoadedQuestions(responseData.data.question);
        // console.log(responseData.data.question.answers[0].description);
        setFormData(
          {
            name: {
              value: responseData.data.question.name,
              isValid: true
            },
            category: {
              value: responseData.data.question.category,
              isValid: true
            },
            subCategory: {
              value: responseData.data.question.subCategory,
              isValid: true
            },
            mark: {
              value: responseData.data.question.subCategory,
              isValid: true
            },
            expextedTime: {
              value: responseData.data.question.expextedTime,
              isValid: true
            }
            ,
            correctAnswers: {
              value: responseData.data.question.correctAnswers,
              isValid: true
            }
            ,
            createdAt: {
              value: responseData.data.question.createdAt,
              isValid: true
            },
            answers: [{
              // name: {
              //   value: "",
              //   isValid: true
              // },
              answer: {
                value: responseData.data.question.answers[0].answer,
                isValid: true
              },
              description: {
                value: responseData.data.question.answers[0].description,
                isValid: true
              }
            }
            ]
          },
          true
        );


        console.log(responseData);

      } catch (err) {
        console.log("zft erorr");
        setError(err.message);
      }
      setIsLoading(false);
    };
    fetchQuestion();
  }, [setFormData]);

  if (isLoading) {
    return (
      <div className="center">
        <h2>Loading...</h2>
      </div>
    );
  }
  if (!loadedQuestions && !error) {
    return (<div className="center">
      <Card>
        <h2>Could not find place!</h2>
      </Card>
    </div>);
  }

  const errorHandler = () => {
    setError(null);
  }

  return (
    <React.Fragment>
      <ErrorModel error={error} onClear={errorHandler} />
      {!isLoading && loadedQuestions && (


        <div className="topping">

          <input
            type="checkbox"
            id="topping"
            name="topping"
            value="Paneer"
            checked={isChecked}
            onChange={handleOnChange}
          />
        </div>
      )}
      
      <li className="place-item">
        <Card className="place-item__content">
          {/* <div className="place-item__image">
            <img src={props.image} alt={props.title} />
          </div> */}
          <div className="place-item__info">
            <h2>{props.id}</h2>
            <h3>{props.name}</h3>
            <p>{props.mark}</p>
            <p>{props.category}</p>
            <p>{props.subCategory}</p>
            <p>{props.correctAnswers}</p>
            {/* <p>{props.answers}</p> */}
            {props.answers.map(q => (
              <>
                {/* <p>{q.key}</p> */}
                {/* <li key="{q}">{q}</li> */}
                <p>{q.name}</p>
                <p>{q.description}</p>
              </>
            ))}
          </div>
        </Card>
      </li>
    </React.Fragment>
  );
};

export default GetAllQuestions;
